    const certArr = [
        { name: "google", image: "/static/ashley-saleem-west.jpg", link: "https://www.google.com"},
        { name: "google", image: "/static/ashley-saleem-west.jpg", link: "https://www.google.com"},
        { name: "google", image: "/static/ashley-saleem-west.jpg", link: "https://www.google.com"},
    ]

    return <section id="certifications">
        <div className="container">
            {certArr.map( (cert, index) => {
                <a key={index} href={cert.link} title={cert.name}>
                    <img src={cert.image} className="certification-im"/>
                </a>
            })}
        </div>
    </section>
}
